import React from "react";
import './contacts.css';
import img from '../../images/contact.svg';

export default function Contacts(){
    return(
        <>
        <div className="contacts" id="contacts">
            <div className="left">
                <img src={img} alt="" />
            </div>
            <div className="right">
                 <h1>Contact Me</h1>
                 <div className="form">
                     <input type="email" placeholder="  Email" />
                     <textarea name="text" id="" placeholder=" Type message" cols="30" rows="10"></textarea>
                 </div>
            </div>
        </div>
        </>
    );
}
